    // \n        const $container = $('<div class=\"w-e-droplist\"></div>')\n\n        // \n        const $title = $(`<p>${conf.title}</p>`)\n        $title.addClass('w-e-dp-title')\n        $container.append($title)\n\n        // \n        const list = conf.list || []\n        const type = conf.type || 'list'\n        // item \n        const clickHandler = conf.clickHandler || EMPTY_FN\n\n        //  DOM \n        const $list = $('<ul class=\"' + (type === 'list' ? 'w-e-list' : 'w-e-block') + '\"></ul>')\n        list.forEach(item => {\n            const $elem = item.$elem\n\n            const value = item.value\n            const $li = $('<li class=\"w-e-item\"></li>')\n            if ($elem) {\n                $li.append($elem)\n                $list.append($li)\n                $li.on('click', () => {\n                    clickHandler(value)\n\n                    // item  list\n                    this.hideTimeoutId = window.setTimeout(() => {\n                        this.hide()\n                    })\n                })\n            }\n        })\n        $container.append($list)\n\n        // \n        $container.on('mouseleave', () => {\n            this.hideTimeoutId = window.setTimeout(() => {\n                this.hide()\n            })\n        })\n\n        // \n        this.$container = $container\n        this.rendered = false\n        this._show = false\n    }\n\n    /**\n     *  DropList\n     */\n    public show() {\n        if (this.hideTimeoutId) {\n            // \n            clearTimeout(this.hideTimeoutId)\n        }\n\n        const menu = this.menu\n        const $menuELem = menu.$elem\n        const $container = this.$container\n        if (this._show) {\n            return\n        }\n        if (this.rendered) {\n            // \n            $container.show()\n        } else {\n            //  DOM \n            const menuHeight = $menuELem.getSizeData().height || 0\n            const width = this.conf.width || 100 //  100\n            $container.css('margin-top', menuHeight + 'px').css('width', width + 'px')\n\n            //  DOM\n            $menuELem.append($container)\n            this.rendered = true\n        }\n\n        // \n        this._show = true\n    }\n\n    /**\n     *  DropList\n     */\n    public hide() {\n        if (this.showTimeoutId) {\n            // \n            clearTimeout(this.showTimeoutId)\n        }\n\n        const $container = this.$container\n        if (!this._show) {\n            return\n        }\n        // \n        $container.hide()\n        this._show = false\n    }\n\n    public get isShow() {\n        return this._show\n    }\n}\n\nexport default DropList\n"]},_coverageSchema:"1a1c01bbd47fc00a2c39e90264f33305004495a9",hash:"5c96eb87ae8aac62644a7ee9369adc28f696614a"});var t=l[n];return i=function(){return t},t}i();var c=(i().s[0]++,void i().b[0][0]++&&(i().b[0][1]++,(void 0).__importDefault)||(i().b[0][2]++,function(n){return i().f[0]++,i().s[1]++,i().b[2][0]++,n&&(i().b[2][1]++,n.__esModule)?(i().b[1][0]++,n):(i().b[1][1]++,{default:n})}));i().s[2]++,(0,o.default)(A,"__esModule",{value:!0});var r=(i().s[3]++,c(e(2))),u=(i().s[4]++,e(30)),s=(i().s[5]++,function(){function n(n,A){i().f[2]++;var e=(i().s[6]++,this);i().s[7]++,this.hideTimeoutId=0,i().s[8]++,this.showTimeoutId=0,i().s[9]++,this.menu=n,i().s[10]++,this.conf=A;var l=(i().s[11]++,r.default('<div class="w-e-droplist"></div>')),o=(i().s[12]++,r.default("<p>"+A.title+"</p>"));i().s[13]++,o.addClass("w-e-dp-title"),i().s[14]++,l.append(o);var c=(i().s[15]++,i().b[3][0]++,A.list||(i().b[3][1]++,[])),s=(i().s[16]++,i().b[4][0]++,A.type||(i().b[4][1]++,"list")),a=(i().s[17]++,i().b[5][0]++,A.clickHandler||(i().b[5][1]++,u.EMPTY_FN)),m=(i().s[18]++,r.default('<ul class="'+("list"===s?(i().b[6][0]++,"w-e-list"):(i().b[6][1]++,"w-e-block"))+'"></ul>'));i().s[19]++,(0,t.default)(c).call(c,(function(n){i().f[3]++;var A=(i().s[20]++,n.$elem),l=(i().s[21]++,n.value),t=(i().s[22]++,r.default('<li class="w-e-it